import React from "react";
import { Link } from "react-router-dom";

class Header extends React.Component {
    render() {
        const { history } = this.props;

        const handleNavigation = (path) => {
            history.push(path);
        };

        return (
            <header>
                <div className="logo-container">
                    <img
                        src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                        alt="AC Milan Logo"
                        className="logo-img"
                    />
                    <span className="logo-text">AC Milan</span>
                    <ul className="nav">
                        <li onClick={() => handleNavigation("/about")}>Про клуб</li>
                        <li onClick={() => handleNavigation("/team")}>Основна команда</li>
                        <li onClick={() => handleNavigation("/youth")}>Молодіжна команда</li>
                    </ul>
                </div>
                <div className="presentation"></div>
            </header>
        );
    }
}

export default Header;
